query QueryRenderersCitySavedListQuery(
  $citySlug: String!
) {
  me {
    ...CitySavedList_me
    __id
  }
}

fragment CitySavedList_me on Me {
  followsAndSaves {
    shows(first: 20, city: $citySlug, after: "") {
      edges {
        node {
          id
          _id
          __id
          name
          status
          href
          is_followed
          exhibition_period
          cover_image {
            url
          }
          location {
            coordinates {
              lat
              lng
            }
            __id
          }
          type
          start_at
          end_at
          partner {
            __typename
            ... on Partner {
              name
              type
            }
            ... on ExternalPartner {
              name
              __id
            }
            ... on Node {
              __id
            }
          }
          __typename
        }
        cursor
      }
      pageInfo {
        endCursor
        hasNextPage
      }
    }
  }
  __id
}
